import React, { useState } from 'react';
import EmployeeForm from './employeeForm';
import EmployeeEdit from './employeeEdit';
import EmployeeDetails from './employeeFormDetails';
import EmployeeDelete from './employeeDelete';
import Popup from './Popup'; // Импортируем компонент Popup
import data from '../data.json';
import '../styles/accounting.css';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';

function Accounting() {
    const [isModalOpen, setIsModalOpen] = useState(false);
    const [isEditModalOpen, setIsEditModalOpen] = useState(false);
    const [isDeleteModalOpen, setIsDeleteModalOpen] = useState(false);
    const [isDetailsOpen, setIsDetailsOpen] = useState(false);
    const [isButtonVisible, setIsButtonVisible] = useState(true); // Добавляем состояние для управления видимостью кнопки "Добавить"
    const [isEditButtonVisible, setIsEditButtonVisible] = useState(true); // Добавляем состояние для управления видимостью кнопки "Редактировать"
    const [employees, setEmployees] = useState(data);
    const [selectedEmployee, setSelectedEmployee] = useState(null); // Состояние для хранения выбранного сотрудника

    const handleOpenModal = () => {
        setIsModalOpen(true);
        setIsButtonVisible(false); // Скрываем кнопку "Добавить" при открытии модального окна
    };

    const handleCloseModal = () => {
        setIsModalOpen(false);
        setSelectedEmployee(null);
        setIsButtonVisible(true); // Показываем кнопку "Добавить" при закрытии модального окна
    };

    const handleEditModalOpen = () => {
        setIsEditModalOpen(true);
        setIsEditButtonVisible(false); // Скрываем кнопку "Редактировать" при открытии модального окна
    };

    const handleEditModalClose = () => {
        setIsEditModalOpen(false);
        setSelectedEmployee(null);
        setIsEditButtonVisible(true); // Показываем кнопку "Редактировать" при закрытии модального окна
    };

    // Остальные методы обработки событий оставляем без изменений...

    return (
        <div>
            <div style={{ marginBottom: '10px' }}>
            </div>

            {/* Модальное окно для добавления нового сотрудника */}
            {isModalOpen && (
                <div className="modal-overlay">
                    <EmployeeForm onCloseModal={handleCloseModal} onAddEmployee={handleAddEmployee} />
                </div>
            )}

            {/* Модальное окно для редактирования существующего сотрудника */}
            {isEditModalOpen && selectedEmployee && (
                <div className="modal-overlay">
                    <EmployeeEdit
                        employeeData={selectedEmployee}
                        onUpdateEmployee={handleUpdateEmployee}
                        onCloseModal={handleEditModalClose}
                    />
                </div>
            )}

            {/* Остальные модальные окна оставляем без изменений... */}

            {/* Таблица с данными о сотрудниках */}
            <table className="employee-table">
                <thead>
                    <tr>
                        <th>Имя</th>
                        <th>Должность</th>
                        <th>Допуск</th>
                        <th>Действие</th>
                    </tr>
                </thead>
                <tbody>
                    {employees.map((employee, index) => (
                        <tr key={index}>
                            <td>{employee.name}</td>
                            <td>{employee.position}</td>
                            <td>{employee.access}</td>
                            <td>
                                <button className="button" onClick={() => handleShowDetails(employee)}>Детали</button>
                                {isEditButtonVisible && ( // Показываем кнопку "Редактировать" только если isEditButtonVisible равно true
                                    <button className="button" onClick={() => handleEditEmployee(employee)}>Редактировать</button>
                                )}
                                <button className="button" onClick={() => handleDeleteEmployee(employee)}>Удалить</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            {/* Кнопка для добавления нового сотрудника */}
            <div className="containeradd text-center">
                {isButtonVisible && ( // Показываем кнопку "Добавить" только если isButtonVisible равно true
                    <Fab color="primary" aria-label="add" onClick={handleOpenModal}>
                        <AddIcon />
                    </Fab>
                )}
            </div>
        </div>
    );
}

export default Accounting;
